import React from "react";
import { Link } from "react-router-dom";

const Card = (props) => {
    return (
        <>
            
                <div className="mainCard">
                <Link><img src={props.image} ></img></Link>
                    <div className="detail">
                        <p>{props.name}</p>
                    </div>
                </div>
            
        </>
    );
}
export default Card;
